                    <td style={{ padding: 12 }}>
                      <span className="badge" style={{ background: r.paymentStatus === 'completed' ? '#22c55e' : r.paymentStatus === 'failed' ? '#ef4444' : '#f59e0b', color: '#fff', padding: '4px 8px', borderRadius: 6 }}>
